      <HeaderComponent />
      <MainContentComponent />
      <FooterComponent />
    </div>
  );
  */
  // Set our state
  const [count, setCount] = useState(0);

  return <>
      <p>{count}</p>
      <button onClick={() => setCount((count)=>count-1)}>
          set count -1
      </button>
      <button onClick={() => setCount((count)=>count+1)}>
          set count +1
      </button>
  </>;
}
